import React, { useState } from "react";
import { Helmet } from "react-helmet";
import { Link } from "react-router-dom";
import "./home.css";

const Home = (props) => {
  // Langkah 1: Tentukan state lokal untuk mengontrol pop-up
  const [showPopup, setShowPopup] = useState(false);

  // Langkah 3: Buat fungsi handler untuk menampilkan pop-up
  const togglePopup = () => {
    setShowPopup(!showPopup);
  };

  return (
    <div className="home-container">
      <Helmet>
        <title>exported project</title>
      </Helmet>
      {/* Kodingan yang telah Anda sediakan */}
      {/* Tambahkan elemen yang akan menampilkan pop-up */}
      <div className="popup" style={{ display: showPopup ? "block" : "none" }}>
        {/* Langkah 4: Logika kondisional untuk menampilkan pop-up */}
        {showPopup && (
          <div className="popup-inner">
            {/* Konten pop-up disini */}
            <span className="close-popup" onClick={togglePopup}>
              Close
            </span>
          </div>
        )}
      </div>

      {/* Tambahkan elemen Link yang akan memunculkan pop-up */}
      <Link
        to="/group149-variant2"
        className="event-nav-link"
        onClick={togglePopup}
      >
        <img
          src="/external/ellipse22i147-3km5.svg"
          alt="Ellipse22I147"
          className="event-ellipse22"
        />
      </Link>

      {/* Kodingan yang telah Anda sediakan */}
      {/* Sisanya dari kodingan yang telah Anda sediakan */}
    </div>
  );
};

export default Home;
